export const newUser = {
  type: "NEW_USER"
};

const initialState = {
  users: ["oi", "eia"]
};
const SignUpReducer = (state = initialState, action) => {
  switch (action.type) {
    case "NEW_USER":
      return { ...state, users: state.users };
    default:
      return state;
  }
};

export default SignUpReducer;
